//"Pluck out fields for Employees"
//
if(sdc.records.length > 0)
{
  //sdc.records[0].value['test'] = sdc.records[0].value['jsonOut']['feed']['entry'].length;
  //sdc.output.write(sdc.records[0]);

	var records = sdc.records;
	try { 

		var firstRecord = records[0];

      	var metadataLinks = firstRecord.value['jsonOut']['feed']['link'];
		var prevLink, nextLink, firstIdProcessed = 999999, maxIdProcessed = 0;

		for(var i = 0; i < metadataLinks.length; i++) 
		{
			if(metadataLinks[i]['rel'] === 'prev')
			{
				sdc.pipelineParameters()['PrevLink'] = metadataLinks[i]['href'];
			}
			if(metadataLinks[i]['rel'] === 'next')
			{ 
				//sdc.log.warn("Pluck metadata next link: " +sdc.state['nextLink'], "Hi, its Evan");					
				sdc.pipelineParameters()['NextLink'] = metadataLinks[i]['href'];
			}
		}

		var totalRecordsToProcess = sdc.records[0].value['jsonOut']['feed']['entry'].length;
		for(var i = 0; i < totalRecordsToProcess; i++) 
		{

          if(undefined == sdc.records[0].value['jsonOut']['feed']['entry'][i]['category'].length) // One record only
		  {  
			var singleEntry = sdc.records[0].value['jsonOut']['feed']['entry'][i]['category'];
			sdc.records[0].value['jsonOut']['feed']['entry'][i]['category'] = [];        
			sdc.records[0].value['jsonOut']['feed']['entry'][i]['category'].push(singleEntry);  
		  }

			var updateCategory = firstRecord.value['jsonOut']['feed']['entry'][i]['category'][0]['term'];
			var linkToGetStaffInfo = "IGNORE";
			var links = firstRecord.value['jsonOut']['feed']['entry'][i]['link'];

				for(var j = 0; j < links.length; j++)
				{
					if(links[j]['rel'] === 'engagement')
					{
					   linkToGetStaffInfo = links[j]['href'];
					}
				}

          	var idVal = firstRecord.value['jsonOut']['feed']['entry'][i]['id'];

			if(idVal <= firstIdProcessed)
			{
			  firstIdProcessed = idVal;
			}

			if(idVal >= maxIdProcessed)
			{
			  maxIdProcessed = idVal;
			}

			var jsonRecord = {'updateCategory':updateCategory,'linkToGetStaffInfo':linkToGetStaffInfo, 'id':idVal, 'lastRecordAlreadyProcessed': firstRecord.value['lastRecordAlreadyProcessed'] };

          //var jsonRecord = { 'test':i , 'id':idVal };

			var newRec = sdc.createRecord('test:' + i);
			newRec.value = jsonRecord;
			sdc.output.write(newRec);
		}

		sdc.pipelineParameters()['lastIdProcessed'] = maxIdProcessed;
		sdc.pipelineParameters()['firstIdProcessed'] = firstIdProcessed;
	}
	catch (e) {
	   sdc.log.warn("In Pluck catch. error mesasge: "+e.message, "test");
	}

}

