var Path = Java.type("java.nio.file.Paths");
var Files = Java.type("java.nio.file.Files");
var pathObj = Path.get('/share/Markers/BlockList.json');
var lines = Files.readAllLines(pathObj);
var blockList = JSON.parse(lines[0]);

var records = sdc.records;
for(var i = 0; i < records.length; i++) {
  try {

    var obj = sdc.records[i].value['engagementDetails'];
    var coID = obj['client']['uri'].substring(obj['client']['uri'].indexOf('clients')+8);
    var clientStr = '{';
    clientStr = clientStr + '\"id\":' + coID
      + ', \"name\":' + '\"' + obj['client']['name'] + '\"'
      + ', \"code\":' + '\"' + obj['client']['shortName'] + '\"'
      + ', \"shortName\":' + '\"' + obj['client']['shortName'] + '\"'
      + ', \"isPrivateClient\":false'; 
    clientStr = clientStr + '}';
    sdc.records[i].value['clientStr'] = clientStr;

    //blockList check
    sdc.records[i].value['onBlockList'] = blockList.filter(function (e) {return e.cId == coID;}).length; //# of times it is found

    var restrictedStr = 'false';
    if (obj['isRestricted'] == 'yes') {restrictedStr = 'true'}

    var activeStr = 'false';
    if (obj['status'] == 'Active') {activeStr = 'true'}

    var coOfficeCountryCode = sdc.records[i].value['coOffice']['country'];

    var engagementStr = '\"id\":' + obj['uri'].substring(obj['uri'].indexOf('engagements')+12)
      + ', \"name\":' + '\"' + obj['name'] + '\"'
      + ', \"practiceType\":' + '\"' + obj['practiceType'] + '\"'
      + ', \"restricted\":' + restrictedStr
      + ', \"isPrivateClient\":false'
      + ', \"active\":' + activeStr
      + ', \"coordinatingOffice\":{\"countryCode\":\"' + coOfficeCountryCode + '\"}';
    sdc.records[i].value['engagementStr'] = engagementStr;

    var adminsStr = '[';
    var adminsStr2 = '[';
    var admins = obj['administrators'];
    for(var a = 0; a < admins.length; a++) {
      adminsStr = adminsStr + admins[a]['uri'].substring(admins[a]['uri'].indexOf('staff')+6) + ',';

      adminsStr2 = adminsStr2 + '{'
        + '\"staffID\":' + admins[a]['uri'].substring(admins[a]['uri'].indexOf('staff')+6)
      	+ ', \"officeType\":' + '\"admin\"'
      	+ ', \"officeCountry\":' + '\"' + admins[a]['office'].substring(admins[a]['office'].length-2) + '\"'
      	+ ', \"displayToClient\":true' + '},';
    }
    adminsStr = adminsStr + ']';
    sdc.records[i].value['adminsStr'] = adminsStr.replace(",]","]");
    adminsStr2 = adminsStr2 + ']';
    sdc.records[i].value['adminsStr2'] = adminsStr2.replace(",]","]");

    var engStaffStr = '[';
    var coOffices = obj['coordinatingOffices'];
    for(var c = 0; c < coOffices.length; c++) {
      engStaffStr = engStaffStr + '{'
        + '\"staffID\":' + coOffices[c]['primaryContact']['uri'].substring(coOffices[c]['primaryContact']['uri'].indexOf('staff')+6)
      	+ ', \"officeType\":' + '\"' + coOffices[c]['type'].replace(' ','_') + '\"'
      	+ ', \"officeCountry\":' + '\"' + coOffices[c]['name'].substring(coOffices[c]['name'].length-2) + '\"'
      	+ ', \"displayToClient\":' + coOffices[c]['primaryContact']['isShowInMyTeam'] + '},';
    }
    var suOffices = obj['subscribedOffices'];
    for(var s = 0; s < suOffices.length; s++) {
      engStaffStr = engStaffStr + '{'
        + '\"staffID\":' + suOffices[s]['primaryContact']['uri'].substring(suOffices[s]['primaryContact']['uri'].indexOf('staff')+6)
      	+ ', \"officeType\":' + '\"subscribed_office\"'
      	+ ', \"officeCountry\":' + '\"' + suOffices[s]['name'].substring(suOffices[s]['name'].length-2) + '\"'
      	+ ', \"displayToClient\":' + suOffices[s]['primaryContact']['isShowInMyTeam'] + '},';
    }
    engStaffStr = engStaffStr + ']';
    sdc.records[i].value['engStaffStr'] = engStaffStr.replace(",]","]");

    // Write record to processor output
    sdc.output.write(records[i]);
  }
  catch (e) {
    // Send record to error
    sdc.error.write(records[i], e);
  }
}

